  fetch('https://jsonplaceholder.typicode.com/users')
      .then(response => response.json())
      .then(json => setUserData(json))
},[])


  return (
    <div className="App">
    <input type="text" />
      {userData?.map((val,idx)=>{
        console.log(val,idx);
